Queer, punk rockstars preaching to uproot systems of oppression while looking fine af 
@riverside.pride @itsdamag3 @noahreasoner @noirbenny 
#pridefest #queerpride

@mandy.slate and I made a love song about being two, young adults attempting to consciously build a healthy relationship. I’ve often observed queer love stories told in terms of pain and brokenness, but what about intentionality, compassion, and health? Written, produced and performed by exclusively two lgbtq+ identifying women - “Same Old Story” is a sync-able, cinematic, light-electronic, pop-rock hit. I can’t be convinced otherwise. 
@brklynwilde is a beast on 🎥🎥
